sys_variable_value.value:
(function execute(inputs, outputs) {

  //Get all Employees
  var arrayEmployees = inputs.ArrayEmployees.Employee;
  var allMissingEmployees = [];
  var allUserSysIds = [];

  //Search through the integration table
  for(var i = 0;i < arrayEmployees.length;i++) {
    var employee = arrayEmployees[i];

    //Check integration record
    var itGR = new GlideRecord('u_integration_link');
    itGR.addQuery('u_application', 'nmbrs');
    itGR.addQuery('u_integration_id','IN', employee.Id);
    itGR.query();

    if(!itGR.hasNext()) {
      var employeeInfo = employee.DisplayName + ' (ID: ' + employee.Id + ')';
      allMissingEmployees.push(employeeInfo);
    }
  }
  allMissingEmployees.sort();
  outputs.missinglinks = allMissingEmployees.join('<br/>');

})(inputs, outputs);

